mapper.select:
select

  distinct

'false' as QUERYID,

from ct_score_log




  order by ${orderByClause}


  limit #{limitStart} , #{limitEnd}

select 

from ct_score_log
where OPER_ID = #{operId,jdbcType=DECIMAL}
  and SCORE_DATE = #{scoreDate,jdbcType=TIMESTAMP}
  and USER_ID = #{userId,jdbcType=VARCHAR}

mapper.delete:
delete from ct_score_log
where OPER_ID = #{operId,jdbcType=DECIMAL}
  and SCORE_DATE = #{scoreDate,jdbcType=TIMESTAMP}
  and USER_ID = #{userId,jdbcType=VARCHAR}
